主要技术指标（最多500字）:
本试验仪器主要包括反射器性能测试、轮廓标微棱镜反射器性能测试、突起路标反射器性能测试等试验。该系统由投光系统、弱光接收系统、转台系统、计算机控制系统组成，由微机界面操作，使用方便。
主要技术指标：
1、投光器电源：能发射色温 2856°；K的标准A光源
光斑直径：ф250mm；均匀度 ±5℅；
光电倍增管照度计（ILD-ZEF）：低区域1.999×10°-1.999×103cd;
  高区域1.999×102-1.999×105cd;
光斑照度：10.76 lx。  
试验转动台：水平角±90°,高低角±30°；
准确度：角度0.02°，照度误差<2%;
7、试验卡盘：能够安装ф30mm-ф230mm各种试样；
